'        if (seleccion) {',
'            switch (seleccion.value) {',
'                case ''visual'':',
'                    visual++;',
'                    break;',
'                case ''auditivo'':',
'                    auditivo++;',
'                    break;',
'                case ''kinestesico'':',
'                    kinestesico++;',
'                    break;',
'            }',
'        }',
'    });',
'',
'    // Determina el tipo predominante',
'    let tipoPredominante;',
'    if (visual > auditivo && visual > kinestesico) {',
